import React from "react";
import "./header.css";
// import logo from "../../../public/img/logo.png";

export const Header = () => {
    return (
        <div className="header">
            <label htmlFor="sdc"><input type="checkbox"/></label>
            <h1><img className="logo" src="https://geoffgould.net/to-do-list_logo.jpg" alt=""/></h1>
        </div>
    )
};
